import styled from "styled-components";


export const Wrapper = styled.section`
width: 100%;
display: flex;
 background-image: ${({ bg }) => `url(${bg})`};
 filter: brightness(0.6);
 min-height:200px;
`

export const Logo = styled.img`
aspect-ratio: 1 / 1;
width: 100px;
height: 100px;
filter: brightness(1.5);
margin-left: 50px;
`

export const Title = styled.h1`
color: white;
`
